import React from "react";
import Header from "../Components/Header";

const Home = () => {
  return (
    <>
      <main>
        <Header />
        <h2>
          Find the perfect <strong>design</strong>, <br />
          We find the perfect <strong>artist</strong>.
        </h2>
      </main>
    </>
  );
};

export default Home;
